import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes, Link, useRoutes } from 'react-router-dom';
import CalendarContainer from './CalendarContainer';
import AddEventForm from './AddEventForm';
import MiddleContainer from './MiddleContainer';
import LoginPage from './LoginPage';
import SignupPage from './SignupPage';
import HomePage from './HomePage';
import { doCreateUserWithEmailAndPassword, doSignInWithEmailAndPassword } from './firebase/auth';
import './fonts.css';

function App() {
  const [events, setEvents] = useState([]);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);

  const routesArray = [
    {
      path: "*",
      element: <LoginPage />,
    },
    {
      path: "/login",
      element: <LoginPage />,
    },
    {
      path: "/signup",
      element: <SignupPage />,
    },
    {
      path: "/home",
      element: <HomePage />,
    },
  ];

  const handleAddEvent = (newEvent) => {
    setEvents([...events, newEvent]);
  };

  const handleSignUp = async () => {
    try {
      await doCreateUserWithEmailAndPassword(email, password);
    } catch (error) {
      setError(error.message);
    }
  };

  const handleSignIn = async () => {
    try {
      await doSignInWithEmailAndPassword(email, password);
    } catch (error) {
      setError(error.message);
    }
  };

  const getTodayDate = () => {
    const today = new Date();
    const options = { weekday: 'long', year: 'numeric', month: 'long', day: 'numeric' };
    return today.toLocaleDateString('en-US', options);
  };

  return (
    <Router>
      <div className="App">
        <header className="Header">
          <h1 className='h3'>PlanMate</h1>
          <nav>
            <ul className='h4'>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/events">Events</Link></li>
              <li><Link to="/create">Create Event</Link></li>
              <li><Link to="/profile">Profile</Link></li>
            </ul>
          </nav>
        </header>
        <main className="MainContent">
          <Switch>
            <Route path="/" exact>
              <HomePage />
            </Route>
            <Route path="/login">
              <LoginPage />
            </Route>
            <Route path="/signup">
              <SignupPage />
            </Route>
            <Route path="/create">
              <h2 className='h2'>Create Event</h2>
              <MiddleContainer />
            </Route>
            <Route path="/events">
              <h2 className='h2'>Events</h2>
              <CalendarContainer events={events} />
            </Route>
          </Switch>
        </main>
        <footer className="Footer">
          <p>&copy; 2024 PlanMate</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
